import React from "react";
import './Home.css';
import { Container, Row, Col } from "../../components/Grid";
// import SearchBar from "../../components/SearchBar";

function Home() {

    return (
      <Container fluid>
        <Row>
          <Col size="size md-12">
            <h1 id="header">FIND A BUSINESS </h1>
            <p id="search"> Search </p>
          </Col>
          {/* <SearchBar /> */}
        </Row>

        <Row>
          <Col size="size md-12">
            <h2 id="subheader">Suggested Categories </h2>
          </Col>
        </Row>

        <Row>
          <Col size="size md-12">
            <h2 id="subheader">Suggested Categories </h2>
          </Col>
        </Row>
      </Container>
      );
    }


export default Home;
